          {ingredients9}
        </li>
        <li>
          {ingredients10}
        </li>
        <li>
          {ingredients11}
        </li>
        <li>
          {ingredients12}
        </li>
        <li>
          {ingredients13}
        </li>
        <li>
          {ingredients14}
        </li>
      </ul>
      <p> {instructions} </p>
    </div>
  )
}

export default DinnerItem
